global
    user root
    group root
    daemon
    stats socket /var/run/haproxy/admin.sock mode 660 level admin

defaults
    timeout client  10m
    timeout server  10m
    timeout connect 10s
    timeout tunnel  10m
    timeout check  5s
    option dontlognull

resolvers mydns
    nameserver aliyun 223.5.5.5:53
    nameserver google 8.8.8.8:53
    resolve_retries       3
    timeout retry         1s
    hold other           30m
    hold refused         30m
    hold nx              30m
    hold timeout         30m
    hold valid           30m

frontend stats_front
  bind *:8888                  
  mode http                    
  stats enable                 
  stats uri /haproxy?stats     
  stats realm HAProxy\ Stats   
  stats auth ccking:ccking    
  stats refresh 5s             

frontend fe_main
    bind :::40000-50000
    mode tcp
    tcp-request inspect-delay 1s
    tcp-request content accept if { req_ssl_hello_type 1 }
    acl is_sni_known req_ssl_sni -m found

